          <h5 class="md:hidden lg:hidden mb-3">不接地氣的「平均薪資」</h5>
          <h4 class="sm:hidden md:block lg:block mb-5">不接地氣的「平均薪資」</h4>
          <p class="caption text-black-6">2021 台灣平均經常性薪資為 45,454 新台幣，然而全台灣約有 70% 的受僱者未達到此標準。因此,若只觀察平均數，難以反應真實職場薪資分布。</p>
