          <h4 class="sm:hidden md:block lg:block mb-5">為什麼薪資透明會是一件好事？</h4>
          <p class="caption text-black-6">
            我們想創造公正透明的職場文化。實證指出：薪資策略公開環境下的員工，對工作滿意度、積極性及未來展望都明顯提升，更能明確定位生涯目標。從分享開始改變文化，你可以在真薪話安全暢談你的工作待遇。透過分享，與全台灣 800
