  <section class="bg-white sm:py-10 md:py-10 lg:pt-20 lg:pb-1 max-[1920px]:overflow-x-hidden">
    <div
      class="container mx-auto sm:max-w-[350px] md:max-w-[600px] lg:max-w-7xl flex flex-col justify-center items-center">
      <div class="w-full flex justify-between items-center mb-9">
        <!-- sm text -->
        <h4 class="sm:block md:hidden lg:hidden">薪水檔案櫃</h4>
        <!-- md lg text -->
        <h2 class="sm:hidden md:block lg:block">薪水檔案櫃</h2>
        <div class="sm:hidden lg:flex flex-row justify-center items-start">
          <nav-btn :isCircle="true" :isLeft="true" class="me-5" @click="postsPrev"></nav-btn>
          <nav-btn :isCircle="true" :isLeft="false" @click="postsNext"></nav-btn>
        </div>
      </div>

      <!-- md lg carousel -->
      <div class="sm:hidden md:hidden lg:block lg:w-full">
        <carousel ref="postCarousel" class="w-full" :items-to-show="1" wrap-around>
          <slide v-for="slide in popularPost.length / 3" :key="slide" style="margin-top:25px;margin-bottom:25px;">
            <div class="w-full flex flex-col">
              <div class="w-full flex flex-row mb-6">
                <div v-for="(post, index) in popularPost" :key="post.postId">
                  <card v-if="index >= (slide - 1) * 3 && index <= (slide - 1) * 3 + 2"
                    :class="{ 'me-6': index != (slide - 1) * 3 + 2 }" cate="top" :title="post.title"
                    :company="post.companyName" :overtime="post.overtime" :feeling="post.feeling">
                  </card>
                </div>
              </div>
              <div class="w-full flex flex-row">
                <div v-for="(post, index) in latestPost" :key="post.postId">
                  <card v-if="index >= (slide - 1) * 3 && index <= (slide - 1) * 3 + 2"
                    :class="{ 'me-6': index != (slide - 1) * 3 + 2 }" cate="new" :title="post.title"
                    :company="post.companyName" :overtime="post.overtime" :feeling="post.feeling">
                  </card>
                </div>
              </div>
            </div>
          </slide>
        </carousel>
      </div>

      <!-- sm carousel -->
      <div class="sm:block sm:w-full lg:hidden">
        <carousel ref="smPostCarousel" class="w-full" :items-to-show="1.5" wrap-around snapAlign="start">
          <slide v-for="slide in popularPost.length" :key="slide">
            <div class="w-full flex flex-col">
              <div class="w-full flex flex-row mb-6">
                <div v-for="(post, index) in popularPost" :key="post.postId">
                  <card v-if="index == slide - 1" cate="top" :title="post.title" :company="post.companyName"
                    :overtime="post.overtime" :feeling="post.feeling">
                  </card>
                </div>
              </div>
              <div class="w-full flex flex-row">
                <div v-for="(post, index) in latestPost" :key="post.postId">
                  <card v-if="index == slide - 1" cate="new" :title="post.title" :company="post.companyName"
                    :overtime="post.overtime" :feeling="post.feeling">
                  </card>
                </div>
              </div>
            </div>
          </slide>
        </carousel>
      </div>

    </div>
  </section>

